pragma solidity 0.8.10;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "../libraries/FeeHelper.sol";
import "./IMidasFactory721.sol";

/// @title Midas Pair Interface
/// @author midaswap
/// @notice Required interface of Midas Pair contract

interface IMidasPair721 {


    /// @dev Structure to store the info of pair:
    /// @param floorPriceID: 
    /// @param bestOfferID: 
    /// @param currentPositionID:
    /// @param reserveX: 
    /// @param reserveY: 
    /// @param feesTotal:   
    /// @param feesRoyalty:
    struct PairInformation {
        uint24 floorPriceID;
        uint24 bestOfferID;
        uint208 currentPositionID;
        uint256 reserveX;
        uint256 reserveY;
        uint256 feesTotal;
        uint256 feesProtocol;
        uint256 feesRoyalty;
    }

    /// @dev Structure to store the reserves of bins:
    /// @param reserveX: The current reserve of tokenX of the bin
    /// @param reserveY: The current reserve of tokenY of the bin    
    struct BinReserves{
        uint256 xReserves;
        uint256 yReserves;
    }

    /// @dev Structure to store the price info of position:
    /// @param originBin: The lowest bin where has the liquidity of this position
    /// @param binStep: The step between each bin where has the liquidity of this position
    /// @param binAmount: The amount of the bins where has the liquidity of this position
    struct BinParams {
        uint24 originBin;
        uint24 binStep;
        //uint208 binAmount;
    }

    event SellNFT(uint256 nftTokenId, address from, uint24 tradeBin, uint256 lpTokenID);

    event BuyNFT(uint256 nftTokenId, address from, uint24 tradeBin, uint256 lpTokenID);

    event ERC721PositionMinted(uint256 lpTokenId, uint24 binLower, uint24 binStep, uint256 binAmount, uint256[] _NFTIDs);

    event ERC20PositionMinted(uint256 lpTokenId, uint24 binLower, uint24 binStep, uint256 binAmount);

    event PositionBurned(uint256 lpTokenId, address owner, uint256 nftAmount, uint256 ftAmount, uint256 feeCollected);


    function tokenX() external view returns (IERC721);

    function tokenY() external view returns (IERC20);

    function factory() external view returns (IMidasFactory721);

    function getReservesAndId()
        external
        view
        returns (
            uint256 reserveX,
            uint256 reserveY,
            uint256 floorPriceID,
            uint256 bestOfferID
        );

    function getGlobalFees()
        external
        view
        returns (
            uint256 feesYTotal,
            uint256 feesYProtocol
        );


    function feeParameters() external view returns (uint256 , uint256 , uint256);

    function getBin(uint24 id) external view returns (uint256 reserveX, uint256 reserveY);

    function getFee(uint256 _LPtokenID)  
        external 
        view 
        returns(uint256 _fee);

    function getPriceFromBin(uint24 _id)
        external 
        pure 
        returns(uint256 _Price);

    function getLPFromNFT(uint256 _NFTID)
        external 
        view 
        returns(uint256 _LPtoken );

    function getBinParamFromLP(uint256 _lpTokenID , uint256 _amount)
        external 
        view
        returns(uint256 _totalPrice);

    function sellNFT(uint256 NFTID,  address _to) external returns (uint256 _amountOut);

    function buyNFT(uint256 NFTID, address _to) external;

    function mintNFT(
        uint24[] calldata ids,
        uint256[] calldata NFTIDs,
        address to,
        bool isLimited
    )
        external
        returns (
            uint256 number, 
            uint256 LPtokenID
        );

    function mintFT(
        uint24[] calldata ids,
        address to
    )
        external
        returns (
            uint256 amountIn,
            uint256 LPtokenID
        );

    function burn(
        uint256 LPtokenID,
        address _nftReceiver,
        address to
    ) external returns (uint256 amountY);

    function collectProtocolFees() external returns (uint256 amountY);

    function collectLPFees(uint256 LPtokenID , address _to) external returns (uint256 amountFee);

    function collectRoyaltyFees() external returns (uint256 amountY);

    function updateRoyalty(uint256 _newRate , address payable[] calldata newrecipients, uint256[] calldata newshares) external;

}

