/// @title Midas 
/// @author midaswap
/// @notice Helper contract used for fees calculation
library FeeHelper {
    // using SafeCast for uint256;
    // using TokenHelper for IERC20;

    function getFeeAmountFrom(uint256 _fee, uint256 _amountWithFees) internal pure returns (uint256) {
        return (_amountWithFees * _fee + 1e18 - 1) / 1e18;
    }


    function getFeeAmount(uint256 _fee, uint256 _amount) internal pure returns (uint256) {
        uint256 _denominator = 1e18 + _fee;
        return (_amount * _fee + _denominator - 1) / _denominator;
    }

    // Assuming protocol share  = 10%
    function getFeeAmountDistributionWithRoyalty(uint256 _feeBase, uint256 _rateFee , uint256 _rateRoyalty)
        internal
        pure
        returns (uint256 _feesTotal , uint256 _feesProtocol , uint256 _feesRoyalty)
    {
        unchecked {
            _feesTotal = _feeBase * _rateFee / 1e18 - 1;
            _feesProtocol = _feesTotal / 10 ;
            _feesRoyalty = _feeBase * _rateRoyalty / 1e18 ;
        }
    }




}

